var win = "";
$ = jQuery;

image={web:{base64:"data:image/jpeg;base64,"},content:{base64:"data:image/jpeg;base64,"},applications:{base64:"data:image/jpeg;base64,"},social:{base64:"data:image/jpeg;base64,"},design:{base64:"data:image/jpeg;base64,"},video:{base64:"data:image/jpeg;base64,"},optimization:{base64:"data:image/jpeg;base64,"}};

(function($, IBMCore) {

    $(function() {

        var app = {

            init: function() {
                app.fixInit();
                app.clicktoSave();
                app.clicktoPreview();
                app.typeCard();
                app.linksToAppend();
                app.lastCard();
                app.uploadImage();
                app.clicktoAppend();

            },
            fixInit: function() {
                $('select').select2({width: '248px'});
            },
            uploadImage: function() {
                function readURL(input) {
                    if (input.files && input.files[0]) {
                        var reader = new FileReader();
                        var f = $(input).parents('.uploadimgcontrol');

                        var thefile = $(f).find('.upload');
                        var fileName = $(thefile).val();
                        console.log(thefile);
                        $(f).find('.pathFile').html(fileName)

                        reader.onload = function (e) {
                            $(f).find('.imagevalue').val(e.target.result);
                        }
                        reader.readAsDataURL(input.files[0]);
                        $(f).find(".placeimgInp").text("Upload new image");
                    }
                }

                $(".upload").change(function(){
                    readURL(this);
                });
            },
            typeCard: function() {
                var designIMG = image.design.base64;
                var videoIMG = image.video.base64;
                var contentIMG = image.content.base64;
                var socialIMG = image.social.base64;
                var applicationsIMG = image.applications.base64;
                var optimizationIMG = image.optimization.base64;
                var webIMG = image.web.base64;

                $('.cardtype').on('select2:select', function(){
                    var f = $(this).parents('.cardcontrol');
                    var controller = $(this).parents('.controller');
                    var value = $(":selected", this).text();
                    if (value == 'Design'){
                        $(f).find(".cardBG").val('#4778BB');
                        $(f).find(".cardALT").val('Design');
                        $(f).find(".cardIMG").val(designIMG);
                    }
                    else if (value == 'Video') {
                        $(f).find(".cardBG").val('#AF6EE8');
                        $(f).find(".cardALT").val('Video');
                        $(f).find(".cardIMG").val(videoIMG);
                    }
                    else if (value == 'Content') {
                        $(f).find(".cardBG").val('#F37A26');
                        $(f).find(".cardALT").val('Content');
                        $(f).find(".cardIMG").val(contentIMG);
                    }
                    else if (value == 'Social') {
                        $(f).find(".cardBG").val('#89181B');
                        $(f).find(".cardALT").val('Social');
                        $(f).find(".cardIMG").val(socialIMG);
                    }
                    else if (value == 'Applications') {
                        $(f).find(".cardBG").val('#00B4A0');
                        $(f).find(".cardALT").val('Applications');
                        $(f).find(".cardIMG").val(applicationsIMG);
                    }
                    else if (value == 'Optimization') {
                        $(f).find(".cardBG").val('#4B8400');
                        $(f).find(".cardALT").val('Optimization');
                        $(f).find(".cardIMG").val(optimizationIMG);
                    }
                    else if (value == 'Web') {
                        $(f).find(".cardBG").val('#B6D343');
                        $(f).find(".cardALT").val('Web');
                        $(f).find(".cardIMG").val(webIMG);
                    }
                    else if (value == 'Select one') {
                        $(controller).find('.reset').trigger('reset');
                    }
                });
            },
            lastCard: function() {
                var designIMG = image.design.base64;
                var videoIMG = image.video.base64;
                var contentIMG = image.content.base64;
                var socialIMG = image.social.base64;
                var applicationsIMG = image.applications.base64;
                var optimizationIMG = image.optimization.base64;
                var webIMG = image.web.base64;

                $('.lastcardtype').on('select2:select', function(){
                    var f = $(this).parents('.cardcontrol');
                    var value = $(":selected", this).text();
                    if (value == 'Design'){
                        $(f).find(".lastCardBG").val('#4778BB');
                        $(f).find(".lastCardALT").val('Design');
                        $(f).find(".lastCardIMG").val(designIMG);
                        $(f).find(".lastCardBGContent").val("#6fa4d8");
                    }
                    else if (value == 'Video') {
                        $(f).find(".lastCardBG").val('#AF6EE8');
                        $(f).find(".lastCardALT").val('Video');
                        $(f).find(".lastCardIMG").val(videoIMG);
                        $(f).find(".lastCardBGContent").val("#ba8ff7");
                    }
                    else if (value == 'Content') {
                        $(f).find(".lastCardBG").val('#F37A26');
                        $(f).find(".lastCardALT").val('Content');
                        $(f).find(".lastCardIMG").val(contentIMG);
                        $(f).find(".lastCardBGContent").val('#ffa573');
                    }
                    else if (value == 'Social') {
                        $(f).find(".lastCardBG").val('#89181B');
                        $(f).find(".lastCardALT").val('Social');
                        $(f).find(".lastCardIMG").val(socialIMG);
                        $(f).find(".lastCardBGContent").val("#aa1f24");
                    }
                    else if (value == 'Applications') {
                        $(f).find(".lastCardBG").val('#00B4A0');
                        $(f).find(".lastCardALT").val('Applications');
                        $(f).find(".lastCardIMG").val(applicationsIMG);
                        $(f).find(".lastCardBGContent").val("#41d6c3");
                    }
                    else if (value == 'Optimization') {
                        $(f).find(".lastCardBG").val('#4B8400');
                        $(f).find(".lastCardALT").val('Optimization');
                        $(f).find(".lastCardIMG").val(optimizationIMG);
                        $(f).find(".lastCardBGContent").val("#5da745");
                    }
                    else if (value == 'Web') {
                        $(f).find(".lastCardBG").val('#B6D343');
                        $(f).find(".lastCardALT").val('Web');
                        $(f).find(".lastCardIMG").val(webIMG);
                        $(f).find(".lastCardBGContent").val("#95AE35");
                    }
                    else if (value == 'Select one'){
                        $(".reset").trigger('reset');
                    }
                });
            },
            linksToAppend: function() {
                $('.linktype').on('select2:select', function(){
                    var f = $(this).parents('.linkcontrol');
                    var value = $(":selected", this).text();
                    if (value == 'Read more'){
                        $(f).find(".ContentLink").val('Read more');
                    }
                    else if (value == 'Click here to watch') {
                        $(f).find(".ContentLink").val('Click here to watch');
                    }
                    else if (value == 'Click here to access') {
                        $(f).find(".ContentLink").val('Click here to access');
                    }
                });
            },
            clicktoAppend: function() {
                var max_fields      = 3;
                var x               = 1;
                var y               = 2;
                var z               = 4;
                var w               = 3;
                var wrapper         = $("#allCards");
                var add_button_2    = $("#add_new_row_card");
                $(add_button_2).click(function(e){
                    e.preventDefault();
                    if(x < max_fields) {
                        $(wrapper).append('<div id="' + x + '" class="ibm-fluid ibm-fullwidth ibm-padding-top-2"> <div class="ibm-col-12-10 ibm-center-block"> <div class="ibm-col-12-6 controller ibm-col-medium-12-12"> <form class="ibm-row-form reset" method="post"> <p> <label class="ibm-h2">Card ' + (w++) + '</label> </p><div class="ibm-fluid"> <div class="ibm-col-12-12"> <section class="ibm-clear uploadimgcontrol"> <div class="fileUpload ibm-btn-blue-50 ibm-btn-pri"> <span class="placeimgInp">Upload image</span> <input type="file" class="upload"/> <input type="text" hidden size="500" id="img_card_' + y + '" name="content[' + x + '].card[0].imgCard" class="imagevalue"> </div><div>Path file: </div><div class="pathFile ibm-padding-bottom-1"></div></section> <div class="cardcontrol"> <p> <label class="ibm-column-field-label">Select which card do you want:</label> <span> <select data-searchenabled="false" class="cardtype"> <option value="" selected>Select one</option> <option value="Design">Design</option> <option value="Video">Video</option> <option value="Content">Content</option> <option value="Social">Social</option> <option value="Applications">Applications</option> <option value="Optimization">Optimization</option> <option value="Web">Web</option> </select> </span> </p><input class="cardBG" type="text" name="content[' + x + '].card[0].bg" hidden value=""> <input class="cardALT" type="text" name="content[' + x + '].card[0].altHeader" hidden value=""> <input class="cardIMG" type="text" name="content[' + x + '].card[0].imgHeader" hidden value=""> </div><p> <label for="h1_card_' + y + '">Title:</label> <span> <input type="text" value="" size="46" id="h1_card_' + y + '_1" name="content[' + x + '].card[0].h1"> </span> </p></div></div><div class="ibm-fluid"> <div class="ibm-col-12-12"> <p> <label for="p_card_' + y + '">Content:</label> <span> <textarea cols="44" rows="5" id="p_card_' + y + '_1" name="content[' + x + '].card[0].p"></textarea> <div class="linkcontrol"> <p> <label class="ibm-column-field-label">Select which link do you want:</label> <span> <select data-searchenabled="false" class="linktype"> <option value="" selected>Select one</option> <option value="ReadMore">Read more</option> <option value="toWatch">Click here to watch</option> <option value="toAccess">Click here to access</option> </select> </span> </p><input size="46" placeholder="http://..." class="Link" type="text" name="content[' + x + '].card[0].link" value=""> <input class="ContentLink" type="text" name="content[' + x + '].card[0].contentLink" hidden value=""> </div></span> </p></div></div></form> </div><div class="ibm-col-12-6 controller ibm-col-medium-12-12"> <form class="ibm-row-form reset" method="post"> <p> <label class="ibm-h2">Card ' + (w++) + '</label> </p><div class="ibm-fluid"> <div class="ibm-col-12-12"> <section class="ibm-clear uploadimgcontrol"> <div class="fileUpload ibm-btn-blue-50 ibm-btn-pri"> <span class="placeimgInp">Upload image</span> <input type="file" class="upload"/> <input type="text" hidden size="500" id="img_card_' + z + '" name="content[' + x + '].card[1].imgCard" class="imagevalue"> </div><div>Path file: </div><div class="pathFile ibm-padding-bottom-1"></div></section> <div class="cardcontrol"> <p> <label class="ibm-column-field-label">Select which card do you want:</label> <span> <select data-searchenabled="false" class="cardtype"> <option value="" selected>Select one</option> <option value="Design">Design</option> <option value="Video">Video</option> <option value="Content">Content</option> <option value="Social">Social</option> <option value="Applications">Applications</option> <option value="Optimization">Optimization</option> <option value="Web">Web</option> </select> </span> </p><input class="cardBG" type="text" name="content[' + x + '].card[1].bg" hidden value=""> <input class="cardALT" type="text" name="content[' + x + '].card[1].altHeader" hidden value=""> <input class="cardIMG" type="text" name="content[' + x + '].card[1].imgHeader" hidden value=""> </div><p> <label for="h1_card_' + z + '">Title:</label> <span> <input type="text" value="" size="46" id="h1_card_' + z + '" name="content[' + x + '].card[1].h1"> </span> </p></div></div><div class="ibm-fluid"> <div class="ibm-col-12-12"> <p> <label for="p_card_' + z + '">Content:</label> <span> <textarea cols="44" rows="5" id="p_card_' + z + '" name="content[' + x + '].card[1].p"></textarea> <div class="linkcontrol"> <p> <label class="ibm-column-field-label">Select which link do you want:</label> <span> <select data-searchenabled="false" class="linktype"> <option value="" selected>Select one</option> <option value="ReadMore">Read more</option> <option value="toWatch">Click here to watch</option> <option value="toAccess">Click here to access</option> </select> </span> </p><input size="46" placeholder="http://..." class="Link" type="text" name="content[' + x + '].card[1].link" value=""> <input class="ContentLink" type="text" name="content[' + x + '].card[1].contentLink" hidden value=""> </div></span> </p><p class="ibm-ind-link"><a class="ibm-btn-red-50 ibm-remove-link ibm-btn-pri remove_field" id="remove_field' + x + '" href="#">Remove last line</a> </p></div></div></form> </div></div></div>');
                        x++; y++; z++;
                    };
                    $('select').select2({width: '248px'});
                    app.typeCard();
                    app.uploadImage();
                    app.linksToAppend();
                    if (x >= max_fields) {
                        $("#add_new_row_card").hide();
                    }
                });


                $(wrapper).on("click", ".remove_field", function(e){
                    e.preventDefault();
                    triggerDiv = $(this).attr("id");
                    targetDiv = triggerDiv.substr(12);
                    $('#'+targetDiv).fadeOut('fast', function (){
                        $('#'+targetDiv).animate({
                            scrollTop: $('#allCards').offset().top
                        })
                        $('#'+targetDiv).remove()
                    });
                    max_fields++;
                    $("#add_new_row_card").show();
                });
            },
            clicktoPreview: function() {
                $('#previewtest').click(function test(evt) {
                    evt.preventDefault();
                    var selector = $('#selector').val(),
                    formDataFirst = $(selector).toObject();
                    localStorage.setItem('formDataFirst', JSON.stringify(formDataFirst));
                    if (!win || win.closed) {
                        win = window.open("templates/preview.html");
                    } else {
                        win.window.location.reload();
                    }
                });
            },
            clicktoSave: function() {
                $('#agoravai').click(function test(evt) {
                    evt.preventDefault();
                    $('#agoravai2').remove();
                    var selector = $('#selector').val();
                    var formDataFirst = $(selector).toObject();
                    var json = JSON.stringify(formDataFirst, null, '\t');
                    var blob = new Blob([json], {type: "application/json"});
                    var url  = URL.createObjectURL(blob);
                    $('#content').append('<a id="agoravai2" href="'+url+'" class="ibm-btn-sec ibm-secure-link ibm-margin-bottom-0 ibm-btn-small ibm-btn-white" download="_data.json">Save</a>');
                });
            }
        };
        app.init();

    });


})(jQuery, IBMCore);
